const Search = () => {
  return (
    <div className="search">
      <div className="search__input">
        <input type="text" name="search" />
        <img
          src="https://github.githubassets.com/images/search-key-slash.svg"
          alt="Search icon"
        />
      </div>
    </div>
  );
};

export default Search;
